import React, { useEffect } from 'react';
import '../../css/contact.css';

const Contact = () => {

  useEffect(() => {
    document.title = "SHAREHOME - Contact us";
  });

  return (
    <div className="content">
      <h1 className="title noselect"></h1>
      <h1 className="subtitle">Questions? Comments?</h1>
      <p>Email us at <a className="email" href="mailto:hello@sharehomethegame.com">hello@sharehomethegame.com</a></p>
      <div className="madeby">
        Made by <a href="https://unicornwithwings.com">Pegasus Games</a>
      </div>
    </div>
  );
}

export default Contact;
